import React from "react";

function SettingImageWithAbsoultValue({
  imgUrl,
  top = "auto",
  bottom = "auto",
  right = "auto",
  left = "auto",
}) {
  return (
    <div className="" style={{}}>
      <img
        src={imgUrl}
        alt="#"
        style={{
          width: `100%`,
          top: { top },
          bottom: { bottom },
          right: { right },
          left: { left },
        }}
      />
    </div>
  );
}

export default SettingImageWithAbsoultValue;
